@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix eco: <http://www.example.org/eco/> .

eco:ECommercePlatform rdf:type owl:Class .

eco:hasProduct rdf:type owl:ObjectProperty ;
  rdfs:domain eco:ECommercePlatform ;
  rdfs:range eco:Product .

eco:Product rdf:type owl:Class .

eco:hasPrice rdf:type owl:DatatypeProperty ;
   rdfs:domain eco:Product ;
   rdfs:range xsd:decimal .

eco:hasInventory rdf:type owl:DatatypeProperty ;
   rdfs:domain eco:Product ;
   rdfs:range xsd:integer .

eco:hasVendor rdf:type owl:ObjectProperty ;
  rdfs:domain eco:Product ;
  rdfs:range eco:Vendor .

eco:Vendor rdf:type owl:Class .
eco:hasRating rdf:type owl:DatatypeProperty ;
  rdfs:domain eco:Vendor ;
  rdfs:range xsd:integer .

eco:hasUser rdf:type owl:ObjectProperty ;
  rdfs:domain eco:ECommercePlatform ;
  rdfs:range eco:User .

eco:User rdf:type owl:Class .
eco:hasPurchaseHistory rdf:type owl:DatatypeProperty ;
  rdfs:domain eco:User ;
  rdfs:range xsd:string .

eco:hasPayment rdf:type owl:DatatypeProperty ;
  rdfs:domain eco:User ;
  rdfs:range xsd:string .
